import styled from 'styled-components';

export const NavContainer = styled.nav`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 0;
  margin: 0;
  max-width: 1200px;
  max-height: 10rem;

  ul {
    display: flex;
    gap: 1rem;
    list-style-type: none;
  }

  .logo-container {
    display: flex;

    img {
      width: 100%;
      height: auto;
    }
  }
`;
